import React, { useState } from "react";

const CloudForm = () => {
  const [response, setResponse] = useState("");

  const handleSubmit = (e) => {
    e.preventDefault();
  };

  return (
    <div>
      <label htmlFor="response"></label>
      <input type="text" id="response" required value={response} onChange={setResponse} />
      <button className="button-red-corner" onClick={handleSubmit}>
        Envoyer
      </button>
    </div>
  );
};

export default CloudForm;
